'Action Commissions feature allows you to define per action, or per "anything" commissions.<br/>This way you can define commissions for example per user registration, per download, per visiting specific page, etc.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Функция "Комиссия за действия" позволяет определить комиссии за действие. <br/> Таким образом, вы можете определить комиссии, например, за регистрацию пользователей, за загрузку, за посещение конкретной страницы, и т.д. <br/> <a href="%s" target="_blank"> Дополнительная информация в нашей Базе знаний</a>',
'More help in our Knowledge Base'=>'Дополнительная информация в нашей Базе знаний.',
'Banner rotator is a special type of banner that rotates other banners.<br/>When affiliate inserts rotator to his page, the rotator displays banners that are assigned to the rotator, so the visitor will see another banner every time he visits the affiliates page.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Баннер-ротатор — это особый тип баннера, который показывает другие баннеры. <br/> Когда партнер вставляет ротатор на свою страницу, ротатор показывает баннеры, назначенные ротатору, так что посетитель будет видеть разные баннеры каждый раз, когда он посещает страницы партнера. < br /> <a href = "%s" target="_blank"> Дополнительная информация в нашей Базе знаний</a>',
'Branding free'=>'Без брендинга',
'Branding Free is a special feature that allows you to change the links in the footer of panels and signup form from "Powered by %s" to your own text and link.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Без брендинга — это специальная функция, которая позволяет изменять ссылки в нижней части панели и регистрационной формы с "Powered by %s" на собственный текст и ссылку. <br/> <a href="%s" target="_blank"> Дополнительная информация в нашей Базе знаний</a>',
'Commission Groups'=>'Группы комиссий',
'Commission groups allow you to set different commissions for different users for the same campaign.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Группы комиссий позволяют устанавливать различные комиссии для различных пользователей для одной кампании. <br/> <a href="%s" target="_blank">Дополнительная информация в нашей Базе знаний</a>',
'CPM commissions'=>'CPM комиссии',
'CPM (cost per mille) commissions are a special type of commissions that are rewarded for 1000 impressions, which means for displaying your banners 1000 times.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'CPM (цена за тысячу) — особый тип комиссии, получаемой за 1000 показов баннеров. <br/> <a href="%s" target="_blank">Дополнительная информация в нашей Базе знаний</a>',
'Forced matrix allows you to limit to the number of referrals of subaffiliates any affiliate can refer. It means that every affiliate can have only specified number of children. <a href="%s" target="_blank">More details read in our Knowledge Base</a>'=>'Матрица ограничений позволяет указывать максимальное количество рефералов для субпартнеров. Это означает, что каждый партнер может иметь только указанное количество субпартнеров. <a href="%s" target="_blank">Дополнительная информация в нашей Базе знаний</a>',
'Hosting of %s on  %s servers.'=>'Хостинг %s на %s серверах.',
'Multiple currencies allow you to track sales in multiple currencies.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Мультивалютность позволит вам отслеживать продажи в различных валютах. <br/> <a href="%s" target="_blank">Дополнительная информация в нашей Базе знаний</a>',
'Multiple merchants'=>'Несколько продавцов',
'By default, all campaigns in %s are public, which means that all affiliates can view and promote them. Private campaigns feature allows you to create private campaigns, which will be visible only to selected affiliates.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'По умолчанию, все кампании в %s являются открытыми, что означает, что все партнеры могут просматривать и продвигать их. Особенность закрытых кампаний позволяет создавать частные кампании, которые будут видны только избранным партнерам. <br/> <a href="%s" target="_blank">Дополнительная информация в нашей Базе знаний</a>',
'It alows you to create a special type of promo materials - rebrandable e-books. You can create your PDF e-book only once and upload it to %s.Your affiliates will automatically get their own re-branded copy of the book, with their name, affiliate links, texts, etc. There is no need to run any Windows program for branding, they will simply download rebranded PDF. All the rebranding is made automatically in the background.<br/><a href="%s" target="_blank">%s</a>'=>'Это дозволяет создавать особый тип промо-материалов — ребрендированные электронные книги. Вы можете создать свою электронную книгу в PDF формате только один раз и загрузить ее на %s. Ваши партнеры автоматически получат свои собственные ребрендированные экземпляры книги, с их названиями, партнерскими ссылками, текстом и т.д. Не нужно запускать никакой программы на MS Windows для ребрендинга, они будут просто загружать уже ребрендированный PDF. Весь ребрендинг делается автоматически в фоновом режиме. <br/> <a href="%s" target="_blank"> %s </a>',
'Recurring commissions allow you to reward your affiliates for recurring payments, for example for hosting or membership. <br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Повторяющиеся комиссии позволяют вам вознаграждать ваших партнеров средствами для регулярных платежей, например, за хостинг или другое. <br/> <a href="%s" target="_blank">Дополнительная информация в нашей Базе знаний</a>',
