'It is possible to use following values in ID: {9} - will be replaced by any character in range [0-9], {z} - will be replaced by any character in range [a-z], {Z} - will be replaced by any character in range [A-Z], {X} - will be replaced by any character in range [0-9a-zA-Z], all other characters will be copied to refid as you will specify in format. Example of good format is e.g. {ZZZ}-{XXXXX}-{999}'=>'Возможно использовать такие значения в ID: {9} - будет заменен на любой символ в диапазоне [0-9], {z} - будет заменен на любой символ в диапазоне [a-z], {Z} - будет заменен на любой символ в диапазоне [A-Z], {X} - будет заменен на любой символ в диапазоне [0-9a-ZA-Z], все остальные символы копируются в refid в формате который вы укажете. Пример правильного формата: {ZZZ}-{XXXXX}-{999}',
'Refid format saved'=>'Refid формат сохранен',
'Refid must be in format "%s". Format definition: {9} - will be replaced by any character in range [0-9], {z} - will be replaced by any character in range [a-z], {Z} - will be replaced by any character in range [A-Z], {X} - will be replaced by any character in range [0-9a-zA-Z], all other characters will be unchanged. Example of good format is e.g. {ZZZ}-{XXXXX}-{999}'=>'Refid должен быть в формате " %s". Определение формата: {9} - будет заменен на любой символ в диапазоне [0-9], {z} - будет заменен на любой символ в диапазоне [a-z], {Z} - будет заменен на любой символ в диапазоне [A-Z], {X} - будет заменен на любой символ в диапазоне [0-9a-zA-Z], все остальные символы будут неизменными. Пример правильного формата: {ZZZ}-{XXXXX}-{999}',
