'GeoIp Core module will translate every Ip address into Location (Country, City, Latitude and Longitude).
All other GeoIp functionality is based on this plugin.
If this plugin will not be enabled, other GeoIp plugins will not work too.
Please read more how to configure plugin correctly in section "More info".'=>'Модуль GeoIp Core будет преобразовывать каждый IP-адрес в месторасположение (страна, город, широта и долгота).
Вся остальная GeoIp-функциональность базируется на этом плагине.
Если этот плагин не будет включен, остальные GeoIp-плагины также не будут работать.
Пожалуйста, прочтите подробнее, как корректно сконфигурировать плагин в разделе "Больше информации".',
'GeoIp plugin is based on free GeoIp database offered by MaxMind.<br/>
Plugin requires GeoIp binary database (filename GeoLiteCity.dat) saved in your plugin directory (server/plugins/GeoIp/). <br/>
<b>You can downlaod latest version of GeoIp database from here: %s.</b><br/>
(Don\'t forget to extract downloaded file before copying to plugin directory)</br><hr>

Free GeoIp database has lower accuracy as paid version offered by MaxMind,
but for most of installations it will be enough,
because in most cases you are interested in country level information and
City level is not so important.
<hr>
If you want to have more accurate results of IP identification,
you will need to buy GeoCity library from %s and
replace file GeoLiteCity.dat in your plugin directory with one you received from MaxMind.<hr>
<b>Accuracy of Free GeoIp database:</b> Over 99.3%% on a country level and 76%% on a city level for the US within a 25 mile radius.<br/>
<b>Accuracy of Paid GeoIp database:</b> Over 99.8%% on a country level and 81%% on a city level for the US within a 25 mile radius.</b>'=>'Плагин GeoIp основан на бесплатной версии GeoIp-базы компании MaxMind.<br/>
Для работы плагина нужна бинарная база данных GeoIp (имя файла GeoLiteCity.dat), сохраненная в ваш каталог плагина (server/plugins/GeoIp/). <br/>
<b>Вы можете загрузить самую свежую версию GeoIp-базы отсюда: %s.</b><br/>
(Не забудьте разархивировать скачанный файл перед копированием в каталог плагина)</br><hr>

Бесплатная база GeoIp имеет низкую точность по сравнения с платной версией, предлагаемой MaxMind-ом,
но для большинства случаев она будет достаточной,
потому что, как правило, вам нужна информация уровня страны,
уровень города не столь важен.

<hr>
Если вам нужны более точные результаты IP-идентификации,
нужно купить библиотеку GeoCity на %s и
заменить файл GeoLiteCity.dat в каталоге плагина на полученный из MaxMind-а.<hr>
<b>Точность бесплатной базы:</b> Более 99.3%% на уровне стран и 76%% на уровне городов для США в пределах 25-мильного радиуса.<br/>
<b>Точность платной базы:</b> Более 99.8%% на уровне стран и 81%% на уровне городов для США в пределах 25-мильного радиуса.</b>',
